const baseURL = "http://localhost:3000/api/v1"


export const setMyAudiocards = audiocards => {
    return {
        type: "SET_MY_AUDIOCARDS",
        audiocards
    }
}

export const clearAudiocards = audiocards => {
    return {
        type: "CLEAR_AUDIOCARDS",
    }
}


export const getMyAudiocards = () => {
    return dispatch => {
        return fetch(BASE_URL + "/audiocards", {
            credentials: "include",
            method: "GET",
            headers: {
                "Content-Type": "application/json"
            },
        })
            .then(resp => resp.json())
            .then(response => {
                if (response.error){
                    alert(response.error)
                } else {
                    dispatch(setMyAudiocards(response.data))
                }
            })
            .catch(console.log)
    }
}

